		function pointInPolygon(p, polygon) {
	    var c = 0;
	    var p1 = polygon[0];
	    var n = polygon.length;

	    for (var i=1; i<=n; i++) {
        var p2 = polygon[i % n];
        if (p.lng > Math.min(p1.lng, p2.lng)
					&& p.lng <= Math.max(p1.lng, p2.lng)
					&& p.lat <= Math.max(p1.lat, p2.lat)
					&& p1.lng != p2.lng) {
						var xinters = (p.lng - p1.lng) * (p2.lat - p1.lat) / (p2.lng - p1.lng) + p1.lat;
						if (p1.lat == p2.lat || p.lat <= xinters) {
							c++;
						}
				}
				p1 = p2;
			}
	    // if the number of edges we passed through is even, then it's not in the poly.
	    return c%2!=0;
		}

		return {

			/*
				coords goes in topleft, topright, bottomright, bottomleft
			*/
			get: function(lat, lng) {
				var c;
				for (var utm in utmTable) {
					c = utmTable[utm];
					/* 
						"normalize" coords, should really refactor utmTable
					*/
					var p = [];
					for (var i in c) {
						p.push( { lat:c[i][0], lng:c[i][1] });
					}
					if (pointInPolygon({ lat: lat, lng: lng}, p)) return utm;
				}
				return '*';
			}
		}

